import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { Button } from 'carbon-components-react';


function App() {
  function handleClick(e){
    e.preventDefault();
    console.log('CLICKED');
  }

  return (
    <div className="App">
      <header className="App-header">
        <Button onClick={handleClick}
          className="Login"
          kind="danger"
          disabled = {false}
        >
          LOGIN HERE
        </Button>
      </header>
    </div>
  );
}

export default App;
